import {
    SET_LOGIN_MODAL_WINDOW,
    GET_USER_LOADING,
    GET_USER_LOADED,
    GET_USER_FAILURE
} from '../redux/action-types';


export const setLoginModalWindow = data => {
    return { type: SET_LOGIN_MODAL_WINDOW, payload: data }
}

